巻いたり、包んだり。シンプルだけどたくさんの使い道。 <br>
<br>
大きめのハンカチとしてはもちろん、お弁当包みやかごバックの目隠し、お出かけの際にはさっと広げて端を結べばビブや、キッズ用のスカーフとしても使えて一枚あると色んなシーンで活躍します。<br>
柔らかな肌触りの2重ガーゼは吸水性も良く、乾きやすいので毎日使いたくなること間違いなし。<br>
<br>
薄手のガーゼはバッグの中でもかさばらず、ママの普段使いにも最適です。<br>
<b>国産ガーゼシリーズ。<br>
たっぷり吸って、さっと乾く。使うたびに柔らかい。 <br></b>
<br>
創業から90年以上続く、愛知県の繊維工場で丁寧に製造しています。古来の製法・技法を守りながらも、時代と共に進化し続ける技術。 <br>
<br>
国際的な安全規格であるエコテックス・スタンダード100 クラス1の認証を取得している生地を使用しており、安心して長くお使いいただけます。 <br>
<br>
ふわふわと柔らかで使うたびに肌に馴染む優しさは国産ガーゼならでは。赤ちゃんだけでなく家族みんなが使いたくなる肌触りです。 <br>
<br>
<b>■国産ガーゼの特徴 <br></b>
<br>
吸収性織り方の構造上水分をよく吸収します。発散性にも優れているため、乾きやすくさらっとした状態を保ってくれます。通気性空気を通しやすい構造なので、蒸れにくく心地よい状態を維持します。また重ねたガーゼの間に空気の層が出来るため通気性が良く、乾きやすいのも特徴です。やわらかさ綿の繊維は先端が丸くなっているため肌にも優しく、やわらかな糸は洗うたびに柔らかさが増し、使うたびに肌に馴染んでいきます。
<br>
<b>■エコテックス認証生地使用 <br></b>
<br>
繊維製品に対する国際的な安全基準です。人体に少しでも有害な化学物質が製品より検出されないことなど、厳しい基準をクリアした製品にのみエコテックス・スタンダード100の認定が与えられます。エコテックス100の中でも、もっとも厳しいクラス1（乳幼児用：赤ちゃんが口に入れたり、なめたりしても、有害物資が溶出しないことを意味する）を認証しています。 <br>
